  [],\n\t\"num_tags\": 0,\n\t\"name\": \"partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-time71eff\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0117354 includes time series
  data collected from MOORINGS in the Caribbean Sea from 2010-01-21 to 2012-11-26
  and retrieved during cruise LaPa20100121, LaPa20110116 and LaPa20111203. These data
  include AIR-SEA DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, OXYGEN
  - PERCENT SATURATION, Partial pressure (or fugacity) of carbon dioxide - atmosphere,
  Partial pressure (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE
  TEMPERATURE. The instruments used to collect these data include Bubble type equilibrator
  for autonomous carbon dioxide (CO2) measurement and Carbon dioxide (CO2) gas analyzer.nnThese
  data were collected by Adrienne Sutton, Stacy Maenner and Christopher Sabine of
  US DOC; NOAA; OAR; Pacific Marine Environmental Laboratory as part of the Mooring_La_Parguera_67W_18N_Dec2011_Nov2012,
  Mooring_La_Parguera_67W_18N_Jan2010_Jan2011 and Mooring_La_Parguera_67W_18N_Jan2011_Nov2011
  data set.nnThe Global CO2 Time-series and Moorings Project involves international
  groups from 18 countries who have mounted sensors on moored buoys to provide high
  resolution time-series measurements of atmospheric boundary layer and surface ocean
  CO2 partial pressure (pCO2). The CO2 Time-series and Moorings Project is coordinated
  by UNESCO International Ocean Carbon Coordination Project (IOCCP).\",\n\t\"owner_org\":
